import React from 'react'
import Comment from './Comment'

function CommentsMatch(props) {
    return (
        <div>
            <div>
                <span style={{
                    background: "#E5007D", width: "42%", padding: 10, color: "#fff", display: "inline-block", textAlign: "center", fontSize: 13, margin: 0, fontFamily: "Poppins"
                }}>Matched</span>
                <span style={{ background: "#E9E9EB", width: "42%", padding: 10, color: "#818E94", display: "inline-block", textAlign: "center", fontSize: 13, margin: 0, fontFamily: "Poppins" }} onClick={() => props.setShow(false)}>Not matched</span>
            </div>
            <div>
                {
                    props.comments.length > 0 && props.comments.map(el => < Comment comment={el} key={el._id} />)
                }
            </div>
        </div>
    )
}

export default CommentsMatch
